import React from 'react';
import './FullscreenMenu.css';

function FullscreenMenu({ onClose }) {
    return (
        <div className="fullscreen-menu" id="fullscreenMenu">
            <button className="close-btn" id="closeBtn">&times;</button>
            <div className="fullscreen-menu-title">
                <p>EWHA<br/>Campus Crusade for Christ<br/><br/>단과대별 선배들 편지 읽어보기</p>
            </div>
            <ul className="fullscreen-menu-list">
                <li><a href="index.html">HOME</a></li>
                <li><a href="human.html">인문과학대학</a></li>
                <li><a href="social.html">사회과학대학</a></li>
                <li><a href="nature.html">자연과학대학</a></li>
                <li><a href="tech.html">공과/인공지능대학</a></li>
                <li><a href="music.html">음악/조형예술대학</a></li>
                <li><a href="teach.html">사범대학</a></li>
                <li><a href="manage.html">경영/신산업융합대학</a></li>
                <li><a href="hokma.html">호크마교양대학</a></li>
                <li><a href="med.html">약학/스크랜튼대학</a></li>
            </ul>
        </div>

    );
}

export default FullscreenMenu;
